import React, { useState, useEffect } from "react";
import axios from "axios";

const App = (props) => {
  useEffect(() => {
    axios.get("/jobs").then((res) => {
        console.log(res)
        setData(res.data)
    }).catch(err => console.log(`Error in axios request`, err))
  }, []);
  const [data, setData] = useState([]);
  return (
    <div>
      <p>{data}</p>
    </div>
  );
};
export default App;
